import React from "react";
import { Link } from "react-router-dom";

const SideBar = () => {
  return (
    <>
      <div className="list-group" id="list-tab" role="tablist">
        <Link
          to="#"
          className="list-group-item list-group-item-action  bg-secondary text-white"
          id="list-admin-list" data-bs-toggle="list"
        >
          Admin
        </Link>
        <Link to="exam" className="list-group-item list-group-item-action"  id="list-exan-list" data-bs-toggle="list">
          Exam
        </Link>
        <Link to="topic" className="list-group-item list-group-item-action" id="list-topic-list" data-bs-toggle="list">
          Topic
        </Link>
        <Link to="questions" className="list-group-item list-group-item-action"  id="list-questions-list" data-bs-toggle="list">
          Questions
        </Link>
        <Link to="user" className="list-group-item list-group-item-action"  id="list-home-list" data-bs-toggle="list">
          Add User
        </Link>
      </div>
    </>
  );
};

export default SideBar;
